text:
I just got a copy of this book. It features pictures of the internals of electronic components in truly amazing photographs. We fail to appreciate the technology that goes into making some of these. For example, the whisper-thin bonding wires in a 3656HG Isolation Amplifier (pp 266-269) have a vapor-deposited conformal coating. Imagine trying to coat a wire you can barely see.<p>This &quot;coffee-table&quot; book of pictures is well worth the price, if only to see the absolute beauty of our amazing level of technology.<p>Eric Schlaepfer and Windell H. Oskay
&quot;Open Circuits: The Inner Beauty of Electronic Components&quot;
No Starch Press ISBN 978-1-7185-0234-5<p>(and, no, I am in no way related to the authors, the book, or publishers)
